<template>
  <div v-if="!isLoaded" class="loader animate-spin"></div>
  <video v-show="isLoaded" ref="videoPlayer" controls></video>
</template>
<script setup>
import { ref, onMounted } from "vue";

const videoPlayer = ref(null);
const base64Images = [
  "data:image/png;base64,",
  "data:image/png;base64,",
  "data:image/png;base64,",
  "data:image/png;base64,",
  "data:image/png;base64,",
];

const isLoaded = ref(false);

onMounted(() => {
  const canvas = document.createElement("canvas");
  const ctx = canvas.getContext("2d");
  const videoChunks = [];

  if (!ctx) {
    console.error("Canvas context is not supported.");
  }

  canvas.width = 500;
  canvas.height = 300;

  const mediaRecorder = new MediaRecorder(canvas.captureStream(), {
    mimeType: "video/webm",
  });

  mediaRecorder.ondataavailable = (event) => {
    if (event.data.size > 0) {
      videoChunks.push(event.data);
    }
  };

  mediaRecorder.onstop = () => {
    const blob = new Blob(videoChunks, { type: "video/webm" });
    const url = URL.createObjectURL(blob);

    if (videoPlayer.value) {
      videoPlayer.value.src = url;
      isLoaded.value = true;
    }
  };

  mediaRecorder.start();

  let currentIndex = 0;
  const renderNextFrame = () => {
    if (currentIndex < base64Images.length) {
      const image = new Image();
      image.onload = () => {
        ctx.drawImage(image, 0, 0, canvas.width, canvas.height);
        currentIndex++;
        setTimeout(renderNextFrame, 500);
      };
      image.src = base64Images[currentIndex];
    } else {
      setTimeout(() => {
        mediaRecorder.stop();
      }, 1000);
    }
  };

  renderNextFrame();
});
</script>

<style scoped>
.loader {
  border: 10px solid #0f172a;
  border-top: 10px solid #00c16a;
  border-right: 10px solid #00c16a;
  border-bottom: 10px solid #00c16a;
  border-radius: 90%;
  width: 120px;
  height: 120px;
  animation: spin 2s linear infinite;
}
</style>
